import classes from "./MealsSummary.module.css";

const MealsSummary = () => {
  return (
    <section className={classes.summary}>
      <h2>맛있는 음식, 당신에게로</h2>
      <p>
        론칭 1년만에 딜리버리 전용 매장을 포함한 60여개의 매장에서 운영되고
        있습니다.
      </p>
      <p>
        ReactSteak의 모든 음식은 숙련된 셰프가 고퀄리티의 재료들로 갓
        만들어냅니다
      </p>
    </section>
  );
};
export default MealsSummary;
